import 'dart:convert';
import 'package:http/http.dart' as http;
// import 'package:hydrosync/config/config.dart';

void main() async {
  var headers = {
    'Api-Key': 'eocnKXipOkYBDE5X6uoCXgsh6xM3XFW96EkfsaMTg0xohSKVaw', // Usa aqu√≠ la API Key que tienes en Environment.cropIdKey
    'Content-Type': 'application/json',
  };
  var url = Uri.parse(
      'https://crop.kindwise.com/api/v1/identification?details=common_names,type,taxonomy,eppo_code,eppo_regulation_status,gbif_id,image,images,wiki_url,wiki_description,treatment,description,symptoms,severity,spreading&language=en');
  
  var requestBody = json.encode({
    "images": [
      "data:image/jpeg;base64,"
    ],
    "latitude": 49.207,
    "longitude": 16.608,
    "similar_images": true
  });

  try {
    print('Enviando solicitud POST...');
    var response = await http.post(
      url,
      headers: headers,
      body: requestBody,
    );

    // Verificar la respuesta
    print('C√≥digo de estado de la respuesta: ${response.statusCode}');
    print('Cuerpo de la respuesta: ${response.body}');

    if (response.statusCode == 200) {
      print('Solicitud exitosa: ${response.body}');
    } else {
      print('Error en la solicitud: ${response.reasonPhrase}');
    }
  } catch (e) {
    print('Error al enviar la solicitud: $e');
  }
}
